import "./register.css";

export default function Register() {
  const email = useRef();
  const username = useRef();
  const password = useRef();
  const conformPassword = useRef();
  return (
    <div className="login">
      <div className="loginWrapper">
        <div className="loginLeft">
          <h3 className="loginLogo">Facebook</h3>
          <span className="loginDesc">
            Connect with your friends and the world around you on Facebook.
          </span>
        </div>
        <div className="loginRight">
          <div className="loginBox">
            <input placeholder="Username" className="loginInput" />
            <input
              placeholder="Email"
              type="email"
              ref={email}
              className="loginInput"
            />

            <input placeholder="Password" className="loginInput" />
            <input placeholder="Conform Password" className="loginInput" />
            <button className="loginButton">Sign Up</button>
            <button className="registerNewAccount">Log into Account </button>
          </div>
        </div>
      </div>
    </div>
  );
}
